import React from "react"
class Tes2 extends React.Component{
    render(){
        return(
           <div>   
           <div>
           <h1>ID={this.props.id} </h1> 
           <h2>NAME={this.props.name}</h2>
           <h3>CITY={this.props.city}</h3>
           <h4>STATE={this.props.state}</h4>
            <h5>MOBILE:NO={this.props.mobile}</h5>
           </div>

           </div>
        )
    }
}
export default Tes2;
